import React from 'react'
import Header from './Header'
import CreateNote from './CreateNote'
import Note from './Note'

const App2 = () => {
    
    const addNote=(note)=>{
        alert("i am clicked");
    }


    return (
        <div>
            <Header />
            <CreateNote 
            passNote={addNote}
            />
            <Note />
        </div>
    )
}

export default App2;
